    false,nt"url": null,nt"notes": "NODC Accession 0100072 includes chemical,
    physical and time series data collected from MOORINGS in the North Pacific Ocean
    and Olympic Coast National Marine Sanctuary from 2010-07-16 to 2013-01-18. These
    data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE,
    OXYGEN - PERCENT SATURATION, Partial pressure (or fugacity) of carbon dioxide -
    atmosphere, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and
    SEA SURFACE TEMPERATURE. The instruments used to collect these data include Bubble
    type equilibrator for autonomous carbon dioxide (CO2) measurement and Carbon dioxide
    (CO2) gas analyzer.nnThese data were collected by Jeremy Mathis, Adrienne Sutton,
    Christopher Sabine, Sylvia Musielewicz and Stacy Maenner of US DOC; NOAA; OAR; Pacific
    Marine Environmental Laboratory, Al Devol of University of Washington and Jan Newton,
    Matthew Alford and John Mickett of University of Washington; Applied Physics Laboratory
    as part of the Mooring LaPush_125W_48N, Mooring_LaPush_125W_48N_May2011_Oct2011
    and Mooring_LaPush_125W_48N_May2012_Jan2013 data set. CDIAC assigned the following
    cruise ID(s) to this data set: LAPU20100716, LaPu20110524 and LaPu20120526.nnThe
    Global CO2 Time-series and Moorings Project involves international groups from 18
    countries who have mounted sensors on moored buoys to provide high resolution time-series
    measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
    (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
    Ocean Carbon Coordination Project (IOCCP).",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
